TB et peut également être utile dans le traitement des infections urinaires, y compris celles dues à la TB. Elle est recommandée pour le traitement des patients atteints de TB-MR en phase intensive et en phase de continuation. Médicament antituberculeux de 2e ligne bactériostatique oral.','fr',6,'2019-10-11 07:24:37',NULL,NULL,'a9cfd108-f20d-4bc2-9925-8a293e147fd8'),(501,392,'jours observés / jours prescrits x 100. En cas de jours manqués indiqués mais sans jours d’observation, le calcul est le suivant : (jours prescrits - jours manqués)/jours prescrits*100','fr',6,'2019-10-11 07:28:20',NULL,NULL,'f5eb3370-299f-43d4-903e-9c1aa181ab42'),(502,394,'Calcul du taux de DOT global en utilisant :\r\nNumérateur = (nbre de médicaments avec DOT de 100 % x 100) + (nbre de médicaments avec DOT < 100 % et jours d’observation saisis*(jours d’observation/jours prescrits*100)) + (nbre de médicaments avec DOT < 100 % et jours manqués saisis mais sans jours d’observation*((jours prescrit - jours manqués)/jours prescrit*100))\r\nDénominateur = nbre de médicaments avec DOT de 100 % + nbre de médicament sans DOT de 100 %','fr',6,'2019-10-11 07:28:47',NULL,NULL,'699b8740-7d17-4a9b-9ce8-8f75c2170f25'),(503,958,'Antibody Test (e.g. RDT)','fr',6,'2019-10-11 10:39:45',NULL,NULL,'c9ed73c6-e110-475c-923e-b918cbfbca80'),(504,1004,'\'Cliniquement instable (autre maladie)\' compris les troubles de santé mentale','fr',6,'2019-10-11 10:42:51',NULL,NULL,'2c408d7f-94e7-41b2-bdb8-357cf42d091b');
