INSERT INTO `global_property` VALUES ('addresshierarchy.addressToEntryMapUpdaterLastStartTime',NULL,'The module uses this field to store when the AddressToEntryMapUpdater task was last started; DO NOT MODIFY','a77fe3e5-0124-473c-a564-5735422a8ce0',NULL,NULL,NULL,NULL,NULL,NULL),('addresshierarchy.allowFreetext','true','Valid values: true/false. When overriding the address portlet, allow the entry of free text for address fields associated with the address hierarchy by providing an \"Other\" option','1fa784e4-e088-40be-9a9a-880fdb9ab9ec',NULL,NULL,NULL,NULL,NULL,NULL),('addresshierarchy.database_version','2.10.0','DO NOT MODIFY.  Current database version number for the addresshierarchy module.','8d8cdb7f-f7a3-4a37-b67b-dabfd9d580e0',NULL,NULL,NULL,NULL,NULL,NULL),('addresshierarchy.enableOverrideOfAddressPortlet','true','Valid values: true/false. When enabled, the existing \"edit\" component of the address portlet is overridden by the new functionality provided by the address hierarchy module','552333ad-49bd-41a9-9072-9c3c784803f0',NULL,NULL,NULL,NULL,NULL,NULL),('addresshierarchy.initializeAddressHierarchyCacheOnStartup','true','Sets whether to initialize the address hierarchy in-memory cache (which is used to speed up address hierarchy searches.\r\n            Generally, you want to set this to \"true\", though developers may want to set it to false during development\r\n            to speed module start-up.','8054f215-3af0-4e65-9742-761ffbc69d28',NULL,NULL,NULL,NULL,NULL,NULL),('addresshierarchy.mandatory','false','true/false whether or not the addresshierarchy module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','c999f9dc-3833-4cec-831e-e68816ed7337',NULL,NULL,NULL,NULL,NULL,NULL),('addresshierarchy.soundexProcessor',NULL,'If the Name Phonetics module is installed, this defines the name of a soundex algorithm used by the getPossibleFullAddresses service method.','3fe6dd93-7aa4-48b2-8fd7-7a98829cd6c1',NULL,NULL,NULL,NULL,NULL,NULL),('addresshierarchy.started','true','DO NOT MODIFY. true/false whether or not the addresshierarchy module has been started.  This is used to make sure modules that were running  prior to a restart are started again','b4de80fc-0fa4-4c60-80f6-72804bfe0262',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.allergen.ConceptClasses','Drug,MedSet','A comma-separated list of the allowed concept classes for the allergen field of the allergy dialog','f95f22e2-34ce-4837-abf1-485f9877f1cc',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.concept.allergen.drug','162552AAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the drug allergens concept','8d6c527c-b330-4f9a-93a6-c9ae7ebce1f0',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.concept.allergen.environment','162554AAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the environment allergens concept','657464b6-9266-400f-bd0d-bcf73c0f4e71',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.concept.allergen.food','162553AAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the food allergens concept','7831625b-0e9c-4386-8c90-227073007f4b',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.concept.otherNonCoded','5622AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the allergy other non coded concept','7ff99ddf-ed9e-47eb-be92-ac6a1a3d7c13',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.concept.reactions','162555AAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the allergy reactions concept','79535140-856c-4ca1-882c-64bab312efe9',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.concept.severity.mild','1498AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the MILD severity concept','1a8b6c80-8bde-4a9a-b220-445b45e879f5',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.concept.severity.moderate','1499AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the MODERATE severity concept','1ab693eb-9003-4f34-a568-07d3c267e877',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.concept.severity.severe','1500AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the SEVERE severity concept','19b5cc62-f5d5-47c5-95a9-ed8c7cc193f5',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.concept.unknown','1067AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the allergy unknown concept','ccd83af3-2b89-4e96-93cf-91a6d414a044',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.reaction.ConceptClasses','Symptom','A comma-separated list of the allowed concept classes for the reaction field of the allergy dialog','ebf55933-fe13-4ce5-89de-b76ff4fd0aec',NULL,NULL,NULL,NULL,NULL,NULL),('appframework.mandatory','false','true/false whether or not the appframework module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','9ff9fa1a-9608-4bf2-95dc-41e7c3bd6533',NULL,NULL,NULL,NULL,NULL,NULL),('appframework.started','true','DO NOT MODIFY. true/false whether or not the appframework module has been started.  This is used to make sure modules that were running  prior to a restart are started again','79a00a7b-40ef-48a2-a3fa-bcb59e2a4dda',NULL,NULL,NULL,NULL,NULL,NULL),('application.name','OpenMRS','The name of this application, as presented to the user, for example on the login and welcome pages.','cbe43983-e0af-4a3d-a9d2-6399f6fa6824',NULL,NULL,NULL,NULL,NULL,NULL),('appointments.mandatory','false','true/false whether or not the appointments module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','f3400674-94de-4700-ba8b-800abe9daf5a',NULL,NULL,NULL,NULL,NULL,NULL),('appointments.started','true','DO NOT MODIFY. true/false whether or not the appointments module has been started.  This is used to make sure modules that were running  prior to a restart are started again','46c14716-cb06-416a-89e0-28c7cd1a5688',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.event.urlPatternForAppointments','/openmrs/ws/rest/v1/appointments/{uuid}','URL pattern to use for published appointment events. Default is /openmrs/ws/rest/v1/appointments/{uuid}. If you change default value, please add your custom implementation for the given URL','858504c5-a86d-11e9-8720-061d1f906166',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.event.urlPatternForAppointmentService','/openmrs/ws/rest/v1/appointment-services/{uuid}','URL pattern to use for published appointment service events. Default is /openmrs/ws/rest/v1/appointment-services/{uuid}. If you change default value, please add your custom implementation for the given URL','858361ef-a86d-11e9-8720-061d1f906166',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.event.urlPatternForBedTagMap','/openmrs/ws/rest/v1/bedTagMap/{uuid}','URL pattern to use for published bed tag map events. Default is /openmrs/ws/rest/v1/bedTagMap/{uuid}. If you change default value, please add your custom implementation for the given URL.','814ef82f-a86d-11e9-8720-061d1f906166',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.event.urlPatternForPatientRelationshipChange',NULL,'URL pattern to use for published relationship events. Default is /openmrs/ws/rest/v1/relationship/%s','7b920619-a86d-11e9-8720-061d1f906166',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.event.urlPatternForProgramStateChange',NULL,'URL pattern to use for published program events. Default is /openmrs/ws/rest/v1/programenrollment/{uuid}?v=full','7babad5a-a86d-11e9-8720-061d1f906166',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.event.urlPatternForSurgicalAppointment','/openmrs/ws/rest/v1/surgicalAppointment/{uuid}?v=full','URL pattern to use for published surgical appointment events. Default is /openmrs/ws/rest/v1/surgicalAppointment/{uuid}?v=full. If you change default value, please add your custom implementation for the given URL','81f90aad-a86d-11e9-8720-061d1f906166',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.event.urlPatternForSurgicalBlock','/openmrs/ws/rest/v1/surgicalBlock/{uuid}?v=full','URL pattern to use for published surgical block events. Default is /openmrs/ws/rest/v1/surgicalBlock/{uuid}?v=full. If you change default value, please add your custom implementation for the given URL','81f790de-a86d-11e9