','true','DO NOT MODIFY. true/false whether or not the bahmni.ie.apps module has been started.  This is used to make sure modules that were running  prior to a restart are started again','90ef0dff-2c10-4f40-b6f7-5ac3ef185dcf',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.primaryIdentifierType','7dfc1a64-e42f-11e5-8c3e-08002715d519','Primary identifier type for looking up patients, generating barcodes, etc','247c96d7-59af-4864-8b7a-4d956d32a0cf',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.relationshipTypeMap',NULL,'Relationship Type Map format Eg:{ \"patient\": [\"Sibling\", \"Parent\"],\"provider\": [\"Doctor\"]}.If no value is specified default is  patient relationship.','448d2659-ad47-42e3-afa3-7ac49c03b7b8',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.sqlGet.pastAppointments','SELECT\r\n     app_service.name                                                                                AS `DASHBOARD_APPOINTMENTS_SERVICE_KEY`,\r\n     app_service_type.name                                                                           AS `DASHBOARD_APPOINTMENTS_SERVICE_TYPE_KEY`,\r\n     DATE_FORMAT(start_date_time, \"%d/%m/%Y\")                                                        AS `DASHBOARD_APPOINTMENTS_DATE_KEY`,\r\n     CONCAT(DATE_FORMAT(start_date_time, \"%l:%i %p\"), \" - \", DATE_FORMAT(end_date_time, \"%l:%i %p\")) AS `DASHBOARD_APPOINTMENTS_SLOT_KEY`,\r\n     CONCAT(pn.given_name, \' \', pn.family_name)                                                      AS `DASHBOARD_APPOINTMENTS_PROVIDER_KEY`,\r\n     pa.status                                                                                       AS `DASHBOARD_APPOINTMENTS_STATUS_KEY`\r\nFROM\r\n   patient_appointment pa\r\n   JOIN person p ON p.person_id = pa.patient_id AND pa.voided IS FALSE\r\n   JOIN appointment_service app_service\r\n     ON app_service.appointment_service_id = pa.appointment_service_id AND app_service.voided IS FALSE\r\n   LEFT JOIN provider prov ON prov.provider_id = pa.provider_id AND prov.retired IS FALSE\r\n   LEFT JOIN person_name pn ON pn.person_id = prov.person_id AND pn.voided IS FALSE\r\n   LEFT JOIN appointment_service_type app_service_type\r\n     ON app_service_type.appointment_service_type_id = pa.appointment_service_type_id\r\n WHERE p.uuid = ${patientUuid} AND start_date_time < CURDATE() AND (app_service_type.voided IS FALSE OR app_service_type.voided IS NULL)\r\n ORDER BY start_date_time DESC\r\n LIMIT 5;','Past appointments for patient','8580524e-a86d-11e9-8720-061d1f906166',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.sqlGet.upComingAppointments','SELECT\r\n  app_service.name                                                                                AS `DASHBOARD_APPOINTMENTS_SERVICE_KEY`,\r\n  app_service_type.name                                                                           AS `DASHBOARD_APPOINTMENTS_SERVICE_TYPE_KEY`,\r\n  DATE_FORMAT(start_date_time, \"%d/%m/%Y\")                                                        AS `DASHBOARD_APPOINTMENTS_DATE_KEY`,\r\n  CONCAT(DATE_FORMAT(start_date_time, \"%l:%i %p\"), \" - \", DATE_FORMAT(end_date_time, \"%l:%i %p\")) AS `DASHBOARD_APPOINTMENTS_SLOT_KEY`,\r\n  CONCAT(pn.given_name, \' \', pn.family_name)                                                      AS `DASHBOARD_APPOINTMENTS_PROVIDER_KEY`,\r\n  pa.status                                                                                       AS `DASHBOARD_APPOINTMENTS_STATUS_KEY`\r\nFROM\r\n  patient_appointment pa\r\n  JOIN person p ON p.person_id = pa.patient_id AND pa.voided IS FALSE\r\n  JOIN appointment_service app_service\r\n    ON app_service.appointment_service_id = pa.appointment_service_id AND app_service.voided IS FALSE\r\n  LEFT JOIN provider prov ON prov.provider_id = pa.provider_id AND prov.retired IS FALSE\r\n  LEFT JOIN person_name pn ON pn.person_id = prov.person_id AND pn.voided IS FALSE\r\n  LEFT JOIN appointment_service_type app_service_type\r\n    ON app_service_type.appointment_service_type_id = pa.appointment_service_type_id\r\nWHERE p.uuid = ${patientUuid} AND\r\n      start_date_time >= CURDATE() AND\r\n      (app_service_type.voided IS FALSE OR app_service_type.voided IS NULL)\r\nORDER BY start_date_time ASC;','Upcoming appointments for patient','858146f5-a86d-11e9-8720-061d1f906166',NULL,NULL,NULL,NULL,NULL,NULL),('bahmnicore.mandatory','false','true/false whether or not the bahmnicore module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','873189b1-972a-4244-8084-85d98207bbcd',NULL,NULL,NULL,NULL,NULL,NULL),('bahmnicore.started','true','DO NOT MODIFY. true/false whether or not the bahmnicore module has been started.  This is used to make sure modules that were running  prior to a restart are started again','2293b5a8-b235-412f-9857-73203eb671a4',NULL,NULL,NULL,NULL,NULL,NULL),('bahmnioca.mandatory','false','true/false whether or not the bahmnioca module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','b69067fb-6394-41e1-8dd1-ebaa5b3faa29',NULL,NULL,NULL,NULL,NULL,NULL),('bahmnioca.started','true','DO NOT MODIFY. true/false whether or not the bahmnioca module has been started.  This is used to make sure modules that were running  prior to a restart are started again','541b8a8e-cced-44cf-b353-2f7e90453107',NULL,NULL,NULL,NULL,NULL,NULL),('bedmanagement.mandatory','false','true/false whether or not the bedmanagement module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','3bd0ab8a-8713-4ae2-a0dd-b637dbd3e9d2',NULL,NULL,NULL,NULL,NULL,NULL),('bedManagement.sqlGet.patientListForAdmissionLocation','SELECT\r\n  b.bed_number AS \'Bed\',\r\n  concat(pn.given_name, \' \', ifnull(pn.family_name,\'\')) AS \'Name\',\r\n  pi.identifier AS \'Id\',\r\n  pv.gender AS \'Gender\',\r\n  TIMESTAMPDIFF(YEAR, pv.birthdate, CURDATE()) AS \'Age\',\r\n  admission_provider_name.given_name AS \'Admission By\',\r\n  cast(DATE_FORMAT(latestAdmissionEncounter.max_encounter_datetime, \'%d %b %y %h:%i %p\') AS CHAR) AS \'Admission Time\',\r\n  adtNotes.value_text AS \'ADT Notes\',\r\n  dispositionInfo.providerName AS \'Disposition By\',\r\n  cast(DATE_FORMAT(dispositionInfo.providerDate, \'%d %b %y %h:%i %p\') AS CHAR) AS \'Disposition Time\',\r\n  diagnosis.diagnosisConcept AS \'Diagnosis\',\r\n  diagnosis.certainty AS \'Diagnosis Certainty\',\r\n  diagnosis.diagnosisOrder AS \'Diagnosis Order\',\r\n  diagnosis.status AS \'Diagnosis Status\',\r\n  diagnosis.diagnosis_provider AS \'Diagnosis Provider\',\r\n  cast(DATE_FORMAT(diagnosis.diagnosis_datetime, \'%d %b %y %h:%i %p\') AS CHAR) AS \'Diagnosis Datetime\'\r\nFROM bed_location_map blm\r\n  INNER JOIN bed b\r\n    ON blm.bed_id = b.bed_id AND b.status = \'OCCUPIED\'\r\n  INNER JOIN location l on blm.location_id = l.location_id and l.name = ${location_name}\r\n  INNER JOIN bed_patient_assignment_map bpam ON b.bed_id = bpam.bed_id AND date_stopped IS NULL\r\n  INNER JOIN person pv ON pv.person_id = bpam.patient_id\r\n  INNER JOIN person_name pn ON pn.person_id = pv.person_id\r\n  INNER JOIN patient_identifier pi ON pv.person_id = pi.patient_id\r\n  INNER JOIN patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\r\n  INNER JOIN global_property gp on gp.property=\'bahmni.primaryIdentifierType\' and gp.property_value=pit.uuid\r\n  INNER JOIN (\r\n        SELECT patient_id, max(encounter_datetime) AS max_encounter_datetime,\r\n          max(visit_id) as visit_id, max(encounter_id) AS encounter_id\r\n        FROM encounter INNER JOIN encounter_type ON encounter_type.encounter_type_id = encounter.encounter_type\r\n        WHERE encounter_type.name = \'ADMISSION\'\r\n        GROUP BY patient_id) latestAdmissionEncounter\r\n      ON pv.person_id = latestAdmissionEncounter.patient_id\r\n  LEFT OUTER JOIN obs adtNotes\r\n    ON adtNotes.encounter_id = latestAdmissionEncounter.encounter_id\r\n    AND adtNotes.voided = 0\r\n    AND adtNotes.concept_id = (SELECT concept_id\r\n                              FROM concept_name\r\n                              WHERE name = \'Adt Notes\' AND concept_name_type = \'FULLY_SPECIFIED\' AND locale = \'en\')\r\n  LEFT OUTER JOIN encounter_provider ep ON ep.encounter_id = latestAdmissionEncounter.encounter_id\r\n  LEFT OUTER JOIN provider admission_provider ON admission_provider.provider_id = ep.provider_id\r\n  LEFT OUTER JOIN person_name admission_provider_name\r\n    ON admission_provider_name.person_id = admission_provider.person_id\r\n  LEFT OUTER JOIN (\r\n        SELECT\r\n          bpam.patient_id AS person_id,\r\n          concept_name.name AS disposition,\r\n          latestDisposition.obs_datetime AS providerDate,\r\n          person_name.given_name AS providerName\r\n        FROM bed_patient_assignment_map bpam\r\n          INNER JOIN (SELECT person_id, max(obs_id) obs_id\r\n                      FROM obs WHERE concept_id = (SELECT concept_id\r\n                          FROM concept_name\r\n                          WHERE name = \'Disposition\' AND concept_name_type = \'FULLY_SPECIFIED\' AND locale = \'en\')\r\n                      GROUP BY person_id)\r\n                maxObsId ON maxObsId.person_id = bpam.patient_id\r\n          INNER JOIN obs latestDisposition\r\n            ON maxObsId.obs_id = latestDisposition.obs_id AND latestDisposition.voided = 0\r\n          INNER JOIN concept_name ON latestDisposition.value_coded = concept_name.concept_id AND\r\n                                     concept_name_type = \'FULLY_SPECIFIED\'\r\n          LEFT OUTER JOIN encounter_provider ep ON latestDisposition.encounter_id = ep.encounter_id\r\n          LEFT OUTER JOIN provider disp_provider ON disp_provider.provider_id = ep.provider_id\r\n          LEFT OUTER JOIN person_name ON person_name.person_id = disp_provider.person_id\r\n        WHERE bpam.date_stopped IS NULL\r\n    ) dispositionInfo ON pv.person_id = dispositionInfo.person_id\r\n  LEFT OUTER JOIN (\r\n    SELECT\r\n      diagnosis.person_id AS person_id,\r\n      diagnosis.obs_id AS obs_id,\r\n      diagnosis.obs_datetime AS diagnosis_datetime,\r\n      if(diagnosisConceptName.name IS NOT NULL, diagnosisConceptName.name, diagnosis.value_text) AS diagnosisConcept,\r\n      certaintyConceptName.name AS certainty,\r\n      diagnosisOrderConceptName.name AS diagnosisOrder,\r\n      diagnosisStatusConceptName.name AS status,\r\n      person_name.given_name AS diagnosis_provider\r\n    FROM bed_patient_assignment_map bpam\r\n      INNER JOIN visit latestVisit\r\n        ON latestVisit.patient_id = bpam.patient_id AND latestVisit.date_stopped IS NULL\r\n        AND bpam.date_stopped IS NULL\r\n      INNER JOIN encounter ON encounter.visit_id = latestVisit.visit_id\r\n      INNER JOIN obs diagnosis ON bpam.patient_id = diagnosis.person_id AND diagnosis.voided = 0 AND\r\n          diagnosis.encounter_id = encounter.encounter_id AND\r\n          diagnosis.concept_id IN (\r\n            SELECT concept_id FROM concept_name\r\n            WHERE name IN (\'Coded Diagnosis\', \'Non-Coded Diagnosis\')\r\n              AND concept_name_type = \'FULLY_SPECIFIED\' )\r\n      LEFT OUTER JOIN concept_name diagnosisConceptName\r\n        ON diagnosis.value_coded IS NOT NULL\r\n        AND diagnosis.value_coded = diagnosisConceptName.concept_id\r\n        AND diagnosisConceptName.concept_name_type = \'FULLY_SPECIFIED\'\r\n        AND diagnosisConceptName.locale =\'en\'\r\n      LEFT OUTER JOIN encounter_provider ep ON diagnosis.encounter_id = ep.encounter_id\r\n      LEFT OUTER JOIN provider diagnosis_provider ON diagnosis_provider.provider_id = ep.provider_id\r\n      LEFT OUTER JOIN person_name ON person_name.person_id = diagnosis_provider.person_id\r\n      INNER JOIN obs certainty\r\n        ON diagnosis.obs_group_id = certainty.obs_group_id AND certainty.voided = 0\r\n        AND certainty.concept_id = (\r\n          SELECT concept_id FROM concept_name\r\n          WHERE name = \'Diagnosis Certainty\'\r\n          AND concept_name_type = \'FULLY_SPECIFIED\'\r\n          AND locale = \'en\')\r\n      LEFT OUTER JOIN concept_name certaintyConceptName\r\n        ON certainty.value_coded IS NOT NULL\r\n        AND certainty.value_coded = certaintyConceptName.concept_id\r\n        AND certaintyConceptName.concept_name_type = \'FULLY_SPECIFIED\'\r\n        AND certaintyConceptName.locale = \'en\'\r\n      INNER JOIN obs diagnosisOrder\r\n        ON diagnosis.obs_group_id = diagnosisOrder.obs_group_id AND diagnosisOrder.voided = 0\r\n        AND diagnosisOrder.concept_id = (\r\n          SELECT concept_id FROM concept_name\r\n          WHERE name = \'Diagnosis order\' AND concept_name_type = \'FULLY_SPECIFIED\' and locale =\'en\')\r\n      LEFT OUTER JOIN concept_name diagnosisOrderConceptName\r\n        ON diagnosisOrder.value_coded IS NOT NULL\r\n        AND diagnosisOrder.value_coded = diagnosisOrderConceptName.concept_id\r\n        AND diagnosisOrderConceptName.concept_name_type = \'FULLY_SPECIFIED\'\r\n        AND diagnosisOrderConceptName.locale = \'en\'\r\n      LEFT JOIN obs diagnosisStatus\r\n        ON diagnosis.obs_group_id = diagnosisStatus.obs_group_id AND diagnosisStatus.voided = 0\r\n        AND diagnosisStatus.concept_id = (\r\n          SELECT concept_id FROM concept_name\r\n          WHERE name = \'Bahmni Diagnosis Status\'\r\n          AND concept_name_type = \'FULLY_SPECIFIED\'\r\n          AND locale = \'en\')\r\n      LEFT OUTER JOIN concept_name diagnosisStatusConceptName\r\n        ON diagnosisStatus.value_coded IS NOT NULL\r\n        AND diagnosisStatus.value_coded = diagnosisStatusConceptName.concept_id\r\n        AND diagnosisStatusConceptName.concept_name_type = \'FULLY_SPECIFIED\'\r\n        AND diagnosisStatusConceptName.locale = \'en\'\r\n) diagnosis ON diagnosis.person_id = pv.person_id;','Sql query to get admitted patients details in an Admission Location','84794df2-a86d-11e9-8720-061d1f906166',NULL,NULL,NULL,NULL,NULL,NULL),('bedmanagement.started','true','DO NOT MODIFY. true/false whether or not the bedmanagement module has been started.  This is used to make sure modules that were running  prior to a restart are started again','99871c23-1568-4979-8979-54ed1ab8ba48',NULL,NULL,NULL,NULL,NULL,NULL),('calculation.mandatory','false','true/false whether or not the calculation module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','8028ce6a-3e93-4023-9785-4492b4d2226a',NULL,NULL,NULL,NULL,NULL,NULL),('calculation.started','true','DO NOT MODIFY. true/false whether or not the calculation module has been started.  This is used to make sure modules that were running  prior to a restart are started again','0e541ae2-daaa-40be-b792-78c91b4f6ebf',NULL,NULL,NULL,NULL,NULL,NULL),('concept.causeOfDeath','5002','Concept id of the concept defining the CAUSE OF DEATH concept','446ebec3-3cc6-43c7-8958-7c6137060833',NULL,NULL,NULL,NULL,NULL,NULL),('concept.defaultConceptMapType','NARROWER-THAN','Default concept map type which is used when no other is set','4c362c89-d2e1-4cc2-913f-76d73884dd22',NULL,NULL,NULL,NULL,NULL,NULL),('concept.false','2','Concept id of the concept defining the FALSE boolean concept','bfe79ec7-e55e-4202-88b5-e33e860056e2',NULL,NULL,NULL,NULL,NULL,NULL),('concept.height','5090','Concept id of the concept defining the HEIGHT concept','ed3bd72b-4954-4268-9658-c8954b70c579',NULL,NULL,NULL,NULL,NULL,NULL),('concept.medicalRecordObservations','1238','The concept id of the MEDICAL_RECORD_OBSERVATIONS concept.  This concept_id is presumed to be the generic grouping (obr) concept in hl7 messages.  An obs_group row is not created for this concept.','57da780c-41af-4b32-94b9-e0e92016c075',NULL,NULL,NULL,NULL,NULL,NULL),('concept.none','1107','Concept id of the concept defining the NONE concept','cf76ce46-a457-42f8-a10c-93fe35c88b5f',NULL,NULL,NULL,NULL,NULL,NULL),('concept.otherNonCoded','5622','Concept id of the concept defining the OTHER NON-CODED concept','77f2e970-550e-480e-80ea-e783f08ef7d0',NULL,NULL,NULL,NULL,NULL,NULL),('concept.patientDied','1742','Concept id of the concept defining the PATIENT DIED concept','1f3a3dc4-7ec8-4ff8-b134-86728f4cb84d',NULL,NULL,NULL,NULL,NULL,NULL),('concept.problemList','1284','The concept id of the PROBLEM LIST concept.  This concept_id is presumed to be the generic grouping (obr) concept in hl7 messages.  An obs_group row is not created for this concept.','4bf79ff4-3d99-4771-8fc3-fca08acc5be5',NULL,NULL,NULL,NULL,NULL,NULL),('concept.reasonExitedCare',NULL,'Concept id of the concept defining the REASON EXITED CARE concept','3f2f8b7c-f5ec-412b-9897-1d7b62543f59',NULL,NULL,NULL,NULL,NULL,NULL),('concept.reasonForDeath','Death','Fully Specified name of the Concept Set created as Reasons for death','7fb96596-e42f-11e5-8c3e-08002715d519',NULL,NULL,NULL,NULL,NULL,NULL),('concept.reasonOrderStopped','1812','Concept id of the concept defining the REASON ORDER STOPPED concept','10a59ed0-085f-48f6-9e41-49359e042ae5',NULL,NULL,NULL,NULL,NULL,NULL),('concept.true','1','Concept id of the concept defining the TRUE boolean concept','c3586f75-5fc8-47e4-beb6-209cf0dd4dff',NULL,NULL,NULL,NULL,NULL,NULL),('concept.weight','5089','Concept id of the concept defining the WEIGHT concept','839e9b1d-c0e6-4bba-a99c-1a93fd8611b3',NULL,NULL,NULL,NULL,NULL,NULL),('conceptDrug.dosageForm.conceptClasses',NULL,'A comma-separated list of the allowed concept classes for the dosage form field of the concept drug management form.','c974eb42-416f-4485-be66-e28a50d6391d',NULL,NULL,NULL,NULL,NULL,NULL),('conceptDrug.route.conceptClasses',NULL,'A comma-separated list of the allowed concept classes for the route field of the concept drug management form.','91626580-b3d6-43d6-a98b-bfc37e999d20',NULL,NULL,NULL,NULL,NULL,NULL),('concepts.locked','false','if tru